import React from "react";
import ReactDOM from "react-dom";
import App from "./App";

const name = "Abi";
const element = <p>Hello, {name}!</p>;
ReactDOM.render(
  <React.StrictMode>{element}</React.StrictMode>,
  document.getElementById("root")
);

